import { createSlice } from '@reduxjs/toolkit'

export const directions = createSlice({
    name: 'directions',
    initialState: {
        directions: { 
            directions: 'Go left', 
            question: 'what color i sthe sky?', 
            hint: 'not red', 
            answer: 'blue', }
    }
})
